import React from 'react';
import { BrowserRouter, Route } from 'react-router-dom';
import SignUpUser from './component/SignpUser';
import Dashboard from './component/Dashboard';
import Updateuser from './component/Updateuser';
import Story from './component/Story';
import Home from './component/Home';
import UserAllDetails from './component/UserAlldetails'



function App(props) {
  return (
    <>
      <BrowserRouter>
        <Route path="/" exact render={(props) => { return (<Home  {...props} />) }} ></Route>
        {/* <Route path="/LoginUser" render={(props) => { return (<LoginUser  {...props} />) }} ></Route> */}
        <Route path="/UserAllDetails" render={(props) => { return (<UserAllDetails  {...props} />) }} ></Route>
        <Route path="/dashboard/:user_id" render={(props) => { return (<Dashboard  {...props} />) }} ></Route>
        <Route path="/Updateuser/user" render={(props) => { return (<Updateuser  {...props} />) }} ></Route>
        <Route path="/story" render={(props) => { return (<Story {...props} />) }} ></Route>


      </BrowserRouter>
    </>
  );
}

export default App;
